import React from 'react';
import { Routes, Route } from 'react-router-dom';
import TrainingPage from './components/TrainingPage';

function App() {
    return (
        <Routes>
            <Route path="*" element={<TrainingPage />} />
        </Routes>
    );
}

export default App;
